// src/pages/CodingPracticePage.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const CodingPracticePage = () => {
  const [practices, setPractices] = useState([]);

  useEffect(() => {
    axios.get('/api/coding')
      .then(response => setPractices(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h1 className="text-4xl font-bold mb-4">Coding Practice</h1>
      {practices.map(practice => (
        <div key={practice._id} className="mb-4">
          <h2 className="text-2xl font-bold">{practice.title}</h2>
          <p>{practice.description}</p>
          <a href={practice.link} className="text-blue-500 hover:underline">Start Coding</a>
        </div>
      ))}
    </div>
  );
};

export default CodingPracticePage;
